problems = {
    126: "Գետնից 2 մ բարձրությամբ պատուհանից նետված քարը գետնին ընկավ շենքի պատից sqrt5 մ հեռավորության վրա։ Որքան է քարի տեղափոխության մոդուլը։", 
    127: "XOY կոորդինատային համակարգում նյութական կետի կոորդինատները՝ x=6m, y=8m: Որքան է քարի տեղափոխության մոդուլը։",
    128: "Տրամվայը շարժվում է 36km/h հաստատուն արագությամբ։ Որքան ժամանակում այն կանցնի 500m Ճանապարհ։",
    129: "2 քաղաքների միջև հեռավորությունը 18km:Քաղաքներից միաժամանակ դուրս են գալիս երկու ավտոմեքենա և շարժվում իրար ընդառաջ 15 և 10 m/s արագություններով։ Շարժումն սկսելուց որքան ժամանակ անց նրանք կհանդիպեն։ ",
    130: "2 կետերի միջև հեռավորությունը 600m: Առաջին մարմինը հաստատուն արագությամբ այդ ճանապարհն անցնում է 25s, իսկ երկրորդը 15s:Որքանով է առաջին մարմնի արագությունը փոքր երկրորդ մարմնի արագությունից։",
    131: "300m երկարությամբ ավտոշարասյունը շարժվում է 600m երկարությամբ կամրջով։ Որքան ժամանակում ավտոշարասյունը կանցնի կամուրջը՝շարժվելով V=36km/h:",
    132: "Հավասարաչափ շարժվող մարմինը ճանապարհի 3/4-n անցավ V=15m/s,1/4-n անցավ V=10m/s: Ճանապարհի առաջին հատվածն անցնելու ժամանակը քանի անգամ է մեծ երկրորդ հատվածն անցնելու ժամանակից։",
    133: "Երկու հեծանվորդ շարժվում են հավասարաչափ՝ միմյանց ընդառաջ 15, 10 m/s արագություններով և հանդիպում յուրաքանչյուր 30s մեկ։ Որքան է շրջանաձև վազքուղու երկարությունը։",
    134: "Նյութական կետի շարժումն արտահայտվում է x = -3 + 5t, y = 7 - 12t հավասարումներով։ Որքան է նյութական կետի արագության մոդուլը։",
    135: "Ուղղաթիռը V = 16m/s թռչում է դեպի հյուսիս։ Որքան կլինի ուղղաթիռի արագությունը գետնի նկատմամբ, եթե սկսի փչել V=12m/s քամի։",
    136: "Մոտորանավակը, որի արագությունը ջրի հետ կապված հավվարկման համակարգում = 6m/s, պետք է ամենակարճ ճանապարհով հասնի գետի մյուս ափը։ Ափի նկատմամբ քանի աստիճանի սուր անկյան տակ պետք է ուղղություն վերցնել, եթե գետի հոսանքի V=3m/s:",
    137: "Երկու նավակներ շարժվում են ուղղաձիգ հավասարաչափ, միևնույն ուղղությամբ՝ համապատասխանաբար 12, 9 m/s:Որքան է առաջին նավակի V երկրորդի նկատմամբ։",
    138: "Երկու նավակներ շարժվում են ուղղաձիգ հավասարաչափ, փոխուղղահայաց ուղղություններով՝ մեկը 6, մյուսը 8m/s:Որքան է առաջին նավակի արագությունը երկրորդի նկատմամբ։",
    139: "Ջրի նկատմամբ նավակի շարժման արագությունը երկու անգամ մեծ է գետի հոսանքի արագությունից։ Որոշել երկու կետերի",
    140: "Հեծանվորդը առաջին 6s ընթացքում անցավ 30m, հաջորդ 10s ընթացքում՝110m, իսկ վերջին 4s ընթացքում 20m: Որքան է հեծանվորդի շարժման միջին ճանապարհային արագությունը ամբողջ ճանապարհին։",
    141: "Մոտորանավակը ճանապարհի առաջին կեսն անցավ V=5m/s, իսկ երկրորդ կեսը՝ V=7.5m/s: Գտնեկ միջին ճանապարհային արագությունը ամբողջ ճանապարհին։ ",
    142: "Դահուկորդն սկսում է սահել սարի գագաթից 0.6m/s*s արագացմամբ։ Գտնել միջին ճանապարհային արագոթյունը ամբողջ ճանապարհին։ ",
    143: "Մոտոցիկլավարը, շարժվելով դադարի վիճակից, 1km երկարությամբ ճանապարհահատվածը անցնում է 0.8m/s*s արագացմամբ, Որքան ժամանակում կանցնի այդ հատվածը։",
    144: "Քարը V=8m/s արագությամբ նետում են սառցի հորիզոնական մակերևույթի վրայով Որքան ժամանակ անց այն կանգ կառնի, եթի նրա արագացման մոդուլը 0.4 m/s*s",
    145: "80m/s վայրէջքի արագության դեպքում ինքնաթիռը մինչև կանգ առնելը անցավ 1600m։Որքան է ինքնաթիռի արագացման մոդուլը, եթե շարժումը հավասարաչափ փոփոխական է։",
    146: "1m/s սկզբնական արագությամբ հաստատուն արագացմամբ շարժվող մարմինը, անցնելով որոշ ճանապարհ, ձեռք է բերում 7m/s արագություն։ Որքան է մարմնի արագությունն այդ ճանապարհի կեսին։",
    147: "Տրված է սարից սահող դահուկորդի շարժման հավասարումը՝x=0.2t*t:Որքան է դահուկորդի արագությունը վայրէջքի վերջում, եթե այն տևում է 20s:",
    148: "Տրված է մարմնի շարժման հավասարումը՝ x=16t-2t*t:Ժամանակի հաշվարկման սկզբից որքան ժամանակ անց մարմինը կանգ կառնի:",
    149: "Մարմինը սկսում է ազատ ընկնել 80m բարձրությունից։ Որքան է նրա անկման ժամանակը",
    150: "Problem missing",
    151: "ՈՒղղաձիգ դեպի ներքև 5m/s սկզբնական արագությամբ նետված մարմինը գետնին հասնում է 8s: Որքան է մարմնի արագությունը գետնին հասնելու պահին։ Օդի դիմադրությունը անտեսել։",
    152: "Մարմինն ուղղաձիգ նետված է դեպի ներքև` 6m/s սկզբնական արագությամբ։ Որքան է 3-րդ վայրկյանում մարմնի անցած ճանապարհը։ Օդի դիմադրությունն անտեսել։",
    153: "Ինչ ճանապարհ կանցնի առանց սկզբնական արագության ազատ անկում կատարող մարմինը շարժման 3-րդ վայրկյանում։",
    154: "Դիտորդը գրանցեց, որ ազատ անկում կատարող մարմինը, ինչ-որ պահից սկսած, 2s-ում կատարել է 100m սեղափոխություն։ Որքան էր մարմնի արագությունը դիտման սկզբնական պահին։",
    155: "Մարմինը նետված է ուղղաձիգ վեր 40m/s արագությամբ։ Նատման պահից ինչ նվազագույն ժամանակում մարմնի արագության մոդւոլը կփոքրանա երկու անգամ։ Օդի դիմադրությունն անտեսել։",
    156:"Մարմինը նետված է ուղղաձիգ վեր 40m/s սկզբնական արագությամբ։ Նետման պահից որքան ժամանակում մարմինը կվերադառնա նետման կետը։ Օդի դիմադրությունը անտեսել։",
    157: "Տղան գետնից 20m բարձրությամբ պատուհանից հորիզոնական ուղղութայմբ նետեց գնդակը։ Ինչ արագությամբ էր նետվել գնդակը, եթե այն ընկավ տան հիմքից 10m հեռու։ Օդի դիմադրությունը անտեսել։"
    }
